import React from "react";
function click_item() {
  console.log("loged");
}
function List(props) {
  return (
    <div>
      <ul>
        <li onClick={click_item} textDecoration="line-through">
          {props.item}
        </li>
      </ul>
    </div>
  );
}
export default List;
